import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { Security, createOktaAuth } from '@okta/okta-react'; // Import createOktaAuth

import oktaConfig from './oktaConfig';

const oktaAuth = createOktaAuth(oktaConfig); // Initialize oktaAuth using createOktaAuth

ReactDOM.render(
  <Security oktaAuth={oktaAuth}>
    <App />
  </Security>,
  document.getElementById('root')
);

reportWebVitals();
